contracts/FFPVoting.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingSystem {
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    mapping(uint => Candidate) public candidates;
    mapping(address => bool) public voters;

    uint public candidatesCount;
    uint public winnerID;
    bool public electionEnded;

    event votedEvent (
        uint indexed _candidateId
    );

    constructor() {
        addCandidate("Candidate 1");
        addCandidate("Candidate 2");
        electionEnded = false;
    }

    function addCandidate(string memory _name) private {
        candidatesCount++;
        candidates[candidatesCount] = Candidate(candidatesCount, _name, 0);
    }

    function vote(uint _candidateId) public {
        require(!voters[msg.sender], "You have already voted.");
        require(_candidateId > 0 && _candidateId <= candidatesCount, "No candidate with that ID.");
        require(!electionEnded, "Election has ended.");

        voters[msg.sender] = true;
        candidates[_candidateId].voteCount++;

        emit votedEvent(_candidateId);
    }

    function endElection() public  {
        require(!electionEnded, "Election already ended.");
        electionEnded = true;

        uint maxVotes = 0;
        for(uint i = 1; i <= candidatesCount; i++) {
            if(candidates[i].voteCount > maxVotes) {
                maxVotes = candidates[i].voteCount;
                winnerID = i;
            }
        }
    }

    function getWinner() public view returns (string memory) {
        require(electionEnded, "Election is not over yet.");
        return candidates[winnerID].name;
    }
}

